> Political The Republicans' Mr. Congeniality drops out of speaker race Rep. Jason Chaffetz, R-Utah and his wife Julie leave a news conference on Capitol Hill in Washington, Thursday, Oct. 8, 2015, after a nomination meeting to replace House Speaker John Boehner broke apart. In a stunning move, Majority Leader Kevin McCarthy withdrew his candidacy for House speaker Thursday, throwing Congress' Republican leadership into chaos. (AP Photo/Evan Vucci) 
